const imageData = 'data:image/png;base64,'

const injectStyle = src => {
  const tag = document.createElement('style')
  tag.innerHTML = src
  document.head.appendChild(tag)
}

injectStyle(`
  body {
    overflow: hidden;
  }
 
  @keyframes dot {
    0% {
      top: 50%;
      left: 50%;
    }
    20% {
      top: 10%;
      left: 10%;
    }
    40% {
      top: 80%;
      left: 90%;
    }
    60% {
      top: 60%;
      left: 20%;
    }
    80% {
      top: 10%;
      left: 95%;
    }
    99% {
      opacity: 1;
    }
    100% {
      top: 100%;
      left: 0%;
      opacity: 0;
    }
  }

  .dot {
    position: fixed;
    width: 32px;
    height: 32px;
    border-radius: 50%;
    background-color: black;
    z-index: 10;
    top: 50%;
    left: 50%;
    transform: translateY(-50%) translateY(-50%);
    animation: dot 4000ms 1000ms ease-in;
  }
  
  .hand {
    display: fixed;
    opacity: 0;
    left: 0;
    bottom: 0;
  }
`)
